import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  return (
    <div className="navbar">
      <button className="nav-button" onClick={() => navigate('/experts')}>Uzman</button>
      <button className="nav-button" onClick={() => navigate('/doctors')}>Hekim</button>
      <button className="nav-button" onClick={() => navigate('/dsps')}>DSP</button>
      <button className="nav-button" onClick={() => navigate('/workplaces')}>İş Yeri</button>
      <button className="nav-button" onClick={() => navigate('/accounting')}>Muhasebe</button>
      <button className="nav-button" onClick={() => navigate('/data')}>Veri Aktar</button>
      <button className="nav-button" onClick={handleLogout}>Çıkış</button>
    </div>
  );
};

export default Navbar;
